import styles from './TemplateUrutan.module.css'
import React, { Fragment } from 'react'

const TemplateUrutan = (props) => {
    return (
        <Fragment>
            <div className = {styles.postBox}>
                <div>{props.nomor}</div>-
                <div>{props.waktu}</div>-
                <div>{props.nama}</div>-
                <div>{props.penyakit}</div>-
                <div>{props.stat}</div>
            </div>
        </Fragment>
    )
}

export default TemplateUrutan;
